navmenusrcVS._virtualQueryString:
function (source, callback) {

     var hash = window.location.hash;
    var divs = {
        columns:["isDropdown", "text", "url", "class","dropdown"],
        meta:{"isDropdown": 1, "text": 11, "url": 11, "class": 11,"dropdown": 0 },
        rows:[]
    }
    var groups = _.groupBy(source.rows, function(r) { return r.head});

    //is dropdown


    _.each(groups, (g, k) => {
        //is not dropdown
        if(g.length === 1){
             divs.rows.push({
                    "isDropdown": false,
                    "class": hash === g[0].url ? "active-page":"",
                    "url":g[0].url,
                    "text":g[0].text
                }); 
        } else {
            var isActive = "";
            var dropdown = _.map(g, function(r) { 
                if(r.url === hash){ 
                    isActive = "active-page"
                }
                return {
                    text: r.text,
                    url: r.url
                };
            });
            divs.rows.push({
                    "isDropdown": true,
                    "class": isActive,
                    "dropdown": dropdown
                }); 
        }
    });


    callback(divs);

}

